function GetJD(year,month,day,hour,minute,second) {
    year=parseInt(year);
    month=parseInt(month);
    day=parseInt(day);
    hour=parseInt(hour);
    minute=parseInt(minute);
    second=parseInt(second);

    if(month < 3){
        year--;
        month += 12
    }

    var A = Math.floor(year/100);
    var B = Math.floor(A/4);
    return Math.floor(365.25 * year ) + 2 - A + B
        + Math.floor(30.6 * month - 0.4) + day + 1721025.5 + hour/24.0 + minute/1440.0 + second /86400.0
}

function util_norm(x, from, to) {
    var w=to-from;
    return x-Math.floor((x-from)/w)*w
}

function getDelta(lct)
{
    var ut = LCTToUT(lct, dgmt);
    var gst = UTToGST(ut);
    var lst = GSTToLST(gst, glon);
    var geo_equ = getpos(ut, 10);
    var geo_ecl = EquToEcl(geo_equ[10], ut);

    var geo_equ = getpos(ut - geo_equ[10].GetLength() / lspeed / 24 / 3600, 10);
    var geo_ecl = EquToEcl(geo_equ[10], ut);

    return geo_ecl.GetLon();
}

function getAngleDate(year, ang)
{
    var lct = GetJD(year, 1, 6, 0, 0, 0);
    lct += util_norm(ang-285, 0, 360) * 365.2425 / 360;

    ang *= D2R;
    for(var i = 0; i < 10; i++) {
        delta = getDelta(lct);
        delta = util_norm(delta, ang-PI, TPI);

        if(delta > ang + PI) {
            delta -= TPI;
        }

        lct -= (delta-ang) / TPI * 365.2425;

        if(Math.abs(delta) < 0.0000001) {
            break;
        }
    }

    var dt = deltaT(lct);
    return lct - dt / 3600/24;
}



