function findCityName(lon, lat)
{
    var closed_index = findNearest(lon, lat);
    var ret = city_data[closed_index].city;
    var diff = city_data[closed_index].GetDistance(lon, lat);
    diff = diff * D2R * 6400;
    if(diff > 1) ret = ret + "근처 (" + diff.toFixed(0) + "km)";
    return ret;
}

function findDGMT(lon, lat)
{
    var closed_index = findNearest(lon, lat);
    return city_data[closed_index].dgmt;
}

function findNearest(lon, lat)
{
    // 가장 가까운 도시를 검색
    var diff = 999999999;
    var closed_index = -1;
    for(var i = 0; i < city_data.length; i++)
    {
        var d = city_data[i].GetDistance(lon, lat);
        if(d < diff) {diff = d; closed_index = i;}
    }
    return closed_index;
}




